using System; using System.Collections.Generic;  namespace Project3 {     public class CompareLastName : IComparer<student>     {         List<student> students = new List<student>();          public int Compare(student x, student y)         {             if (x.LastName == null && y.LastName == null) return 0;             else if (x.LastName == null) return -1;             else if (y.LastName == null) return 1;             else return string.Compare(x.LastName, y.LastName, StringComparison.Ordinal);         }     } }  